// About.js

import React from 'react';

const About = () => {
  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>About Us</h1>
      <p style={styles.paragraph}>
        We deliver high-performance IT solutions, offering expert consultations, custom web development, 
        and reliable hosting services tailored to meet your unique business needs. Our goal is to help 
        you succeed online with tailored, client-centered support and innovative solutions.
      </p>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    maxWidth: '800px',
    margin: '0 auto',
    textAlign: 'center',
    fontFamily: 'Arial, sans-serif',
  },
  heading: {
    fontSize: '2.5rem',
    color: '#333',
    marginBottom: '20px',
  },
  paragraph: {
    fontSize: '1.2rem',
    color: '#666',
    lineHeight: '1.6',
  },
};

export default About;
